import styled from "styled-components";
import Navbar from "../components/Navbar/Navbar";

const Container = styled.div``;

const SingleProduct = () => {
  return (
    <Container>
      <Navbar />
      <Wrapper>
        <ImgContainer>
          <Image src="" />
        </ImgContainer>
        <InfoContainer>
          <Title></Title>
          <Description></Description>
          <Price></Price>
        </InfoContainer>
      </Wrapper>
    </Container>
  );
};

export default SingleProduct;
